Candele di pandoro: l'idea golosa per sorprendere tutti!

Le candele di pandoro sono un dolce goloso e originale. Preparatevi a lasciare tutti a bocca aperta! 
INGREDIENTI
1 pandoro;
100g di zucchero;
2 cucchiai di acqua;
180g di cioccolato fondente;
50ml di latte;
100g di budino alla vaniglia;
200ml di latte. 
PREPARAZIONE
Sciogliete il preparato per il budino alla vaniglia nel latte e cuocetelo a fuoco basso finché non diventa denso. Lasciate raffreddare completamente.
Tagliate il pandoro a fette e ricavate dei dischi grazie a degli stampi di varie dimensioni.
Fate un buco al centro dei dischi di pandoro e metteteli uno sopra l’altro.
Sciogliete il cioccolato fondente con il latte e guarnite I dischi di pandoro.
Fate caramellare lo zucchero e usatelo per formare la fiamma delle candele sugli stuzzicadenti.
Versate, nei buchi delle candele, la glassa e mettetene un po’ anche in cima. Infilate al centro gli stuzzicadenti con le fiamme di caramello.

