Stollen di Natale: il dolce soffice e profumato da provare!

Lo stollen è un dolce tedesco soffice e saporito ricco di spezie e frutta secca, ideale per una colazione diversa e golosa nel giorno di Natale! 
INGREDIENTI
2 uova;
150g di zucchero;
200g di ricotta;
200g di burro, temperatura ambiente;
450g di farina;
2 cucchiaini di lievito in polvere;
Scorza di 1 limone;
Scorza 1 arancia;
½ cucchiaino di vaniglia in polvere;
Un pizzico di sale;
130g di mirtilli rossi secchi;
100ml di succo d'arancia;
130g di mix di noccioline e frutta secca. 
PREPARAZIONE
Cuocete nel microonde i mirtilli secchi nel succo d’arancia.
Unite lo zucchero con il sale, l’estratto di vaniglia, la scorza di limone e di arancia. Aggiungete il burro, le uova, la ricotta e continuate a mescolare. Unite la farina con il lievito in polvere e aggiungetelo al composto assieme alle noccioline e alla frutta secca.
Dividete l’impasto in 2 parti, piegateli e cuoceteli in forno a 180° per 40 minuti.
Cospargete lo zucchero a velo e servite.

