Farcite con il cioccolato o la marmellata, queste girelle andranno a ruba! 
INGREDIENTI
Per l'impasto:
600g di farina;
200ml di acqua calda;
200ml di latte caldo;
1 uovo;
1 albume d'uovo;
1 cucchiaino di lievito secco;
90ml di burro fuso;
2 cucchiai di zucchero;
Uovo sbattuto, semi di sesamo. 
Per la miscela di burro:
300g di burro;
90ml di olio vegetale. 
Per il ripieno:
90g di farina;
160g di zucchero;
50g di burro, a cubetti. 
PREPARAZIONE
Unite il latte con l’acqua, l’albume, l’uovo, il burro fuso, il sale e mescolate. Aggiungete la farina e impastate. Fate lievitare l’impasto per 1 ora.
Dividete l’impasto in 10 sfere e lasciatele lievitare per 30 minuti.
Per preparare la miscela di burro: Unite lo zucchero, il sale, la farina, il burro e impastate.
Nel frattempo sciogliete il burro con l’olio vegetale
Stendete le sfere d’impasto il più sottile possibile, bagnateli con il burro fuso e metteteli uno sopra l’altro.
Tagliate l’impasto in 12 strisce e arrotolatele. Formate delle ciotole come mostrato nel video e riempitele con la miscela di burro. Chiudete le ciotole e schiacciatele con le mani.
Spennellate l’uovo sbattuto e cospargete i semi di sesamo.
Cuocete in forno a 200° per 20 minuti. 
